import React from 'react'
import styled from 'styled-components';

const Header = () => {
  return (
    <HeaderContainer>

        <h1>A Fantasy Football Website</h1>
        <h1>Links | Login</h1>

    </HeaderContainer>
  )
}

const HeaderContainer = styled.div`
display: grid;
grid-template-columns: 1fr 1fr;
`;

export default Header
